// color.setPalette(color.Arcade)
forever (() => {
    color.setPalette(color.Adafruit);
    color.Darken.startScreenEffect(1000);
    color.pauseUntilFadeDone();
    color.Brighten.startScreenEffect(1000);
    color.pauseUntilFadeDone();
    color.FadeToBlack.startScreenEffect(2000);
    color.RotatePalette.startScreenEffect(2000)
    new color.Fade()
        .setEndPalette(color.Black)
        .start(2000);
    pause(3000)
    color.startFadeUntilDone(color.Arcade, color.Adafruit, 2000);
    color.startFadeUntilDone(color.Adafruit, color.Matte, 2000);

    const grayArcade = color._clone(color.Arcade);
    grayArcade.setColor(0xF, 0x737373);
    color.startFadeUntilDone(grayArcade, color.Arcade, 1000)

    // fade to black
    color.startFadeUntilDone(color.Arcade, color.Black, 2000);
    color.startFadeUntilDone(color.currentPalette(), color.GrayScale, 2000);

    new color.Fade()
        .setEndColor(0x1, 0xFF0000)
        .setEndColor(0x2, 0x00FF00)
        .setEndColor(0x3, 0x0000FF)
        .setEndColor(0x4, 0xFF00FF)
        .setEndColor(0x5, 0xFFFF00)
        .setEndColor(0x6, 0x00FFFF)
        .setEndColor(0xA, 0xAAAAAA)
        .setEndColor(0xB, 0x05A2B7)
        .setEndColor(0xC, 0x678987)
        .setEndColor(0xD, 0x123456)
        .setEndColor(0xF, 0xFFFFFF)
        .start(2000)
        .pauseUntilDone()
        .reverse()
        .startUntilDone(2000)
        .reverse()
        .mapEndRGB(rgb => {
            rgb.red -= 0x7F;
            rgb.green -= 0x7F;
            rgb.blue -= 0x7F;
            return rgb;
        })
        .startUntilDone(1000);
    color.startFadeUntilDone(color.currentPalette(), color.White, 2000);
});

const targetColor = 4360181;
const parsedStrings = [
    "#4287f5",
    "RGB(66, 135, 245)",
    "sRGB(66, 135, 245)",
    "hsv(217, 73%, 96%)",
    "hsl(217, 90%, 61%)"
]

for (const s of parsedStrings) {
    const parsed = color.parseColorString(s);

    const diff = Math.sqrt(
        (color.unpackR(parsed) - color.unpackR(targetColor)) ** 2 +
        (color.unpackG(parsed) - color.unpackG(targetColor)) ** 2 +
        (color.unpackB(parsed) - color.unpackB(targetColor)) ** 2
    )
    console.log(diff < 100)
}